import { Box, Button, LinearProgress, Typography } from "@mui/material";
import { styled } from "@mui/system";
import React, { useContext, useEffect, useState } from "react";
import MyLogin from "./MyLogin";
import { DataBorneContext } from "./ContextBorne";
import BodyApp from "./BodyApp";

function AppBorneMulhouse1() {
  const {
    MyBox,
    dataBorne,
    setDataBorne,
    progressBar,
    setprogressBar,
    loginEtat,
    setLoginEtat,
    valuesLogin,
    setvaluesLogin,
  } = useContext(DataBorneContext);

  function borneAvailable() {
    let e;
    if (dataBorne.propriety.available === true) {
      e = (
        <Typography variant="h3" sx={{ color: "green" }}>
          Disponible
        </Typography>
      );
    }
    if (dataBorne.propriety.available === false) {
      e = (
        <Typography variant="h3" sx={{ color: "red" }}>
          Indisponible
        </Typography>
      );
    }
    return e;
  }
  function showEtat() {
    let el = (
      <MyBox>
        <Typography>Ini </Typography>
      </MyBox>
    );
    console.log("0");
    console.log(loginEtat);
    if (loginEtat) {
      console.log("1");
      el = (
        <>
          <MyLogin />
          <MyBox>
            <Button
              variant="contained"
              onClick={() => {
                console.log(valuesLogin.email);
                setDataBorne({
                  ...dataBorne,
                  [login.email]: valuesLogin.email,
                  [login.password]: valuesLogin.password,
                });
                console.log(dataBorne);
                setLoginEtat(false);
              }}
            >
              loginEtat
            </Button>
          </MyBox>
        </>
      );
    } else {
      console.log("2");
      el = (
        <MyBox>
          <Typography>Coucou Ã§a marche ? </Typography>
          <Button
            variant="contained"
            onClick={() => {
              setLoginEtat(true);
            }}
          >
            loginEtat
          </Button>
        </MyBox>
      );
    }
    return el;
  }

  return (
    <>
      <MyBox>
        <Typography variant="h2">Borne 1 - Mulhouse</Typography>
      </MyBox>

      <MyBox>{borneAvailable()}</MyBox>
      <MyBox>
        <LinearProgress
          variant="determinate"
          sx={{
            m: 2,
            width: "50%",
            height: 10,
            borderRadius: 5,
          }}
          value={progressBar}
        />
      </MyBox>

      {showEtat()}
    </>
  );
}

export default AppBorneMulhouse1;
